> Top News Carson, Trump request Secret Service protection FILE - In this Oct. 9, 2015 file photo, Republican presidential candidate Dr. Ben Carson speaks at the National Press Club in Washington. The U.S. Secret Service says the top two GOP presidential hopefuls have requested protection from the taxpayer-funded agency. The agency says billionaire real estate developer Donald Trump and retired neurosurgeon Ben Carson have requested Secret Service protection. But they would not receive it until Homeland Security Secretary Jeh Johnson consults with five senior members of Congress. (AP Photo/Andrew Harnik, File) 
